import React, { Component } from "react";

import logo from "../../img/Logo.png";

import "./OnePage.css";
import Button from "@material-ui/core/Button";
import PropTypes from "prop-types";
import {
  withStyles,
  createMuiTheme,
  MuiThemeProvider
} from "@material-ui/core/styles";

const styles = theme => ({});

class OnePage extends Component {
  render() {
    return (
      // Header //
      <MuiThemeProvider theme={theme}>
        <div className="Header">
          <div className="Header-overlay">
            <img className="logo" src={logo} />
            <p className="connexion">
              <span>Se connecter </span>|<span> S'inscrire</span>
            </p>

            <h1 className="textCentral">
              La 1ère plateforme de teams <br /> d'étudiants-stagiaires
            </h1>
            <Button variant="contained" className="buttonConnexion">
              Déposer une offre de stage
            </Button>
            <Button variant="contained" className="buttonConnexion2">
              Postuler à une offre
            </Button>
            <br />
            <Button variant="contained" className="buttonConnexion3">
              Test
            </Button>
          </div>
        </div>
      </MuiThemeProvider>
    );
  }
}
const theme = createMuiTheme({
  palette: {
    primary: amber
  },
  overrides: {
    MuiMobileStepper: {
      dotActive: {
        backgroundColor: "#fdad17"
      },
      dots: {
        margin: "auto"
      }
    }
  }
});

OnePage.propTypes = {
  classes: PropTypes.object.isRequired,
  theme: PropTypes.object.isRequired
};
export default withStyles(styles, { withTheme: true })(OnePage);
